var updateDemand = function (condition,demandId,type) {
    $.ajax({
        url: "/updateDemandFinancial/"+demandId,
        type: 'put',
        async: true,
        data: condition,
        dataType: 'json',
        error: function (obj, msg) {
            alert("服务器异常！")
        },
        success: function (result) {
            if (result != null) {
                console.log(result);
                if(type = "submit"){
                    var data = {
                        workState:"SUBMIT"
                    }
                    updateEntireWorkState(data,entireId)
                }else {
                    getDemandListByEntireId(entireId);
                }

            }

        }
    });
}

